import React, { useState } from 'react';
import PropTypes from 'prop-types';
import { makeStyles } from '@material-ui/core/styles';
import AppBar from '@material-ui/core/AppBar';
import Tabs from '@material-ui/core/Tabs';
import Tab from '@material-ui/core/Tab';
import Typography from '@material-ui/core/Typography';
import Box from '@material-ui/core/Box';
import { TextValidator, ValidatorForm } from 'react-material-ui-form-validator';
import { Button } from '@material-ui/core';



function TabPanel(props) {
  const { children, value, index, ...other } = props;

  return (
    <div
      role="tabpanel"
      hidden={value !== index}
      id={`simple-tabpanel-${index}`}
      aria-labelledby={`simple-tab-${index}`}
      {...other}
    >
      {value === index && (
        <Box p={3}>
          <Typography>{children}</Typography>
        </Box>
      )}
    </div>
  );
}

TabPanel.propTypes = {
  children: PropTypes.node,
  index: PropTypes.any.isRequired,
  value: PropTypes.any.isRequired,
};

function a11yProps(index) {
  return {
    id: `simple-tab-${index}`,
    'aria-controls': `simple-tabpanel-${index}`,
  };
}



export default function SimpleTabs() {
  
  const [value, setValue] = React.useState(0);
  const [signUpState , setSignUpState] = useState({
    id : 0,
    firstname : '',
    lastname : '',
    email : '',
    password : '',
    contactno : '',
  })

  const handleChange = (event, newValue) => {
    setValue(newValue);
  };

  const inputChangedHandler = (e) => {
    const state = addSubsciberForm;
    state[e.target.name] = e.target.value;
    setAddSubscriberForm({...state});
}

  function handleLoginSubmit(){

  }

  const handleSignUpSubmit = (e) => {

  }

  const {firstname , lastname , email , password , contactno} = {signUpState};

  return (
    <div>
      <AppBar position="static">
        <Tabs fill value={value} onChange={handleChange} aria-label="simple tabs example" style={{backgroundColor : 'white' , color : 'black' }}>
          <Tab label="Login" {...a11yProps(0)} />
          <Tab label="Register" {...a11yProps(1)} />
        </Tabs>
      </AppBar>
      <TabPanel value={value} index={0}
      >
        <ValidatorForm className='login-form-container' onSubmit={handleLoginSubmit}>
          <TextValidator
              id ='name'
              label = 'Username*'
              type = 'text'
              name = 'name'
              validators={['required']}
              errorMessages={['Username cannot be empty']}
              style={{left:'25%'}}
          >
          </TextValidator><br/>
          <TextValidator
              id ='password'
              validators={['required']}
              errorMessages={['Password cannot be empty']}
              label="Password*"
              name="password"
              type="password"  
              style={{left:'25%'}}  
          >
          </TextValidator><br/><br/>
          <Button type='Submit' style={{left:'37%',color:'white',backgroundColor:'rgb(83, 102, 249)'}}>Login</Button>
        </ValidatorForm>
      </TabPanel>
      <TabPanel value={value} index={1}>
        <ValidatorForm className='signUp-form-container' onSubmit={handleSignUpSubmit}>
          <TextValidator
                  id ='firstname'
                  label = 'First Name *'
                  type = 'text'
                  name = 'firstname'
                  validators={['required']}
                  errorMessages={['required']}
                  onChange={inputChangedHandler}
                  value = {firstname}
                  style={{left:'25%'}}
              >
            </TextValidator>
            <TextValidator
                  id ='lastname'
                  label = 'Last Name *'
                  type = 'text'
                  name = 'lastname'
                  validators={['required']}
                  errorMessages={['required']}
                  onChange={inputChangedHandler}
                  style={{left:'25%'}}
              >
            </TextValidator>
            <TextValidator
                  id ='email'
                  label = 'Email *'
                  type = 'text'
                  name = 'email'
                  validators={['required' , 'isEmail']}
                  errorMessages={['required']}
                  onChange={inputChangedHandler}
                  style={{left:'25%'}}
              >
            </TextValidator>
            <TextValidator
                  id ='password'
                  label = 'Password *'
                  type = 'password'
                  name = 'password'
                  validators={['required']}
                  errorMessages={['required']}
                  onChange={inputChangedHandler}
                  style={{left:'25%'}}
              >
            </TextValidator>
            <TextValidator
                  id ='contactno'
                  label = 'Contact No *'
                  type = 'number'
                  name = 'contactno'
                  validators={['required']}
                  errorMessages={['required']}
                  onChange={inputChangedHandler}
                  style={{left:'25%'}}
              >
            </TextValidator><br/>
            <Button type='Submit' style={{left:'37%',color:'white',backgroundColor:'rgb(83, 102, 249)'}}>Register</Button>
        </ValidatorForm>

      </TabPanel>
    </div>
  );
}
